import React from "react";
import { Route } from "react-router-dom";
import { Login, Registration } from "../index.js";

const AuthRouter = () => {
  return (
    <Route path="/auth">
      <Route path="login" element={<Login />} />
      <Route path="registration" element={<Registration />} />
    </Route>
  );
};

export default AuthRouter;
